import React from 'react';
import './RichHeritage.css'; // Import your CSS file for styling

const RichHeritage = () => {
  return (
    <section className="section">
      <div className="section__color-wrapper">
        <div className="container">
          <div className="content-box content-box--medium content-box--text-center content-box--center text-container">
            <h1 className="heading h2">Rich Heritage. Boldly Reimagined.</h1>
          </div>
        </div>
      </div>
    </section>
  );
};

export default RichHeritage;
